if mibBuilder.loadTexts: cmplsTeP2mpTunnelDestEntry.setDescription('An entry in this table represents a destination of a P2MP MPLS tunnel. An entry can be created by a network administrator or by an SNMP agent as instructed by an MPLS signaling protocol. Entries in this table share some index fields with the cmplsTeP2mpTunnelTable and the mplsTunnelTable in MPLS-TE-STD-MIB. Entries in this table have no meaning unless there is a corresponding entry in cmplsTeP2mpTunnelTable (which, itself, depends on a corresponding entry in mplsTunnelTable). Note that the same destination may be present more than once if it is in more than one sub-group as reflected by the cmplsTeP2mpTunnelDestSrcSubGroupOriginType, cmplsTeP2mpTunnelDestSrcSubGroupOrigin, cmplsTeP2mpTunnelDestSrcSubGroupID, cmplsTeP2mpTunnelDestSubGroupOriginType, cmplsTeP2mpTunnelDestSubGroupOrigin, and cmplsTeP2mpTunnelDestSubGroupID, index objects. Entries in this table may be created at any time. If created before an entry in the cmplsTeP2mpTunnelTable the entries have no meaning, but may be kept ready for the creation of the P2MP tunnel. If created after the entry in cmplsTeP2mpTunnelTable, entries in this table may reflect the addition of destinations to active P2MP tunnels. For this reason, entries in this table are equipped with row, admin, and oper status objects.')
